// frame points
var points = [[100, 100], [200, 100], [200, 200], [100, 200]];
function nearest_point(xy) {
    function d(xy1, xy2) {
        return (xy1[0] - xy2[0])*(xy1[0] - xy2[0]) + (xy1[1] - xy2[1])*(xy1[1] - xy2[1]);
    }
    var nearest_i = 0;
    var nearest_d = d(xy, points[0]);
    for(var i = 1; i < 4; ++i) {
        const di = d(xy, points[i]);
        if(di < nearest_d) {
            nearest_d = di;
            nearest_i = i;
        }
    }
    return nearest_i;
}
function set_points(xy) {
    const i = nearest_point(xy);
    points[i][0] = xy[0]
    points[i][1] = xy[1]
    if(i == 0) {
        points[1][1] = xy[1];
        points[3][0] = xy[0];
    } else if(i == 1) {
        points[0][1] = xy[1];
        points[2][0] = xy[0];
    } else if(i == 2) {
        points[3][1] = xy[1];
        points[1][0] = xy[0];
    } else if(i == 3) {
        points[2][1] = xy[1];
        points[0][0] = xy[0];
    }
}

function darn(pixels, i0, j0, i1, j1) {
    const w = pixels[0].length;
    const h = pixels.length;
    for(var i = i0; i <= i1; ++i) {
        // weight coefficients for column
        const ki0 = (i0 == 0) ? 0 : 1. / (i - (i0 - 1));
        const ki1 = (i1 == h) ? 0 : 1. / (i1 + 1 - i);
        for(var j = j0; j <= j1; ++j) {
            // weight coefficients for row
            const kj0 = (j0 == 0) ? 0 : 1. / (j - (j0 - 1));
            const kj1 = (j1 == w) ? 0 : 1. / (j1 + 1 - j);
            // donor pixel values
            const pi0 = (i0 == 0) ? 0x00 : pixels[i0 - 1][j];
            const pi1 = (i1 == h) ? 0x00 : pixels[i1 + 1][j];
            const pj0 = (j0 == 0) ? 0x00 : pixels[i][j0 - 1];
            const pj1 = (j1 == w) ? 0x00 : pixels[i][j1 + 1];
            // blending
            const d = ki0 + ki1 + kj0 + kj1;
            const gv = (pi0 * ki0 + pi1 * ki1 + pj0 * kj0 + pj1 * kj1) / d;
            pixels[i][j] = gv;
        }
    }
}

function darn_by_points() {
    darn(pixels, Math.round(points[0][1]), Math.round(points[0][0]), Math.round(points[2][1]), Math.round(points[2][0]));
}

function init_canvas(){
    var canvas = document.getElementById("canvas");
    canvas.width = pixels[0].length;
    canvas.height = pixels.length;
    const canvas_rect = canvas.getBoundingClientRect();

    canvas.addEventListener('mousemove', function(e){
        var canvas_rect = canvas.getBoundingClientRect();
        if(e.buttons == 1){
            const x = e.clientX - canvas_rect.left;
            const y = e.clientY - canvas_rect.top;
            set_points([x, y]);
            draw_canvas();
        }
    }, false);

    canvas.addEventListener('mousedown', function(e){
        var canvas_rect = canvas.getBoundingClientRect();
        const x = e.clientX - canvas_rect.left;
        const y = e.clientY - canvas_rect.top;
        set_points([x, y]);
        draw_canvas();
    }, false);

    canvas.addEventListener('mouseleave', function(e){
        draw_canvas();
    }, false);

    draw_canvas();
}

function draw_canvas(){
    var canvas = document.getElementById("canvas");
    var context = canvas.getContext("2d");
    if(pixels.length == 0)
        return
    const w = pixels[0].length;
    const h = pixels.length;

    // background
    context.fillStyle="#eeeeee";
    context.fillRect(0, 0, w, h);
    
    // pixels
    var pixel_field = context.createImageData(w, h);
    for (var i = 0; i < h; ++i) {
        for (var j = 0; j < w; ++j) {
            pixel_field.data[(i*w + j)*4 + 0] = pixels[i][j];
            pixel_field.data[(i*w + j)*4 + 1] = pixels[i][j];
            pixel_field.data[(i*w + j)*4 + 2] = pixels[i][j];
            pixel_field.data[(i*w + j)*4 + 3] = 0xFF;
        }
    }
    context.putImageData(pixel_field, -0.5, -0.5);
    
    // frame
    context.beginPath();
    context.moveTo(points[0][0] + 0.5, points[0][1] + 0.5);
    context.lineTo(points[1][0] + 0.5, points[1][1] + 0.5);
    context.lineTo(points[2][0] + 0.5, points[2][1] + 0.5);
    context.lineTo(points[3][0] + 0.5, points[3][1] + 0.5);
    context.lineTo(points[0][0] + 0.5, points[0][1] + 0.5);
    context.strokeStyle = "#d64562";
    context.setLineDash([4, 4]);
    context.lineWidth = 3;
    context.stroke();
    context.closePath();
    context.setLineDash([]);
}

    <canvas id="canvas" width=1024 height=1024></canvas>
    <button type="button" onclick="darn_by_points(); draw_canvas();">Darn image</button>
    
    <script language="JavaScript">
    init_canvas();
